import React from "react";
import Notes from "./Note";
import noteDetails from "./noteDetails";

function newNotes(props) {
  return (
    <noteDetails
      key={props.key}
      nTitle={props.title}
      nContent={props.content}
    />
  );
}

function Note() {
  return (
    <div className="note">
      {Notes.map(function newNotes(props) {
        return (
          <noteDetails
            key={props.key}
            nTitle={props.title}
            nContent={props.content}
          />
        );
      })}
      <h1>{props.title}</h1>
      <p>{props.content}</p>
    </div>
  );
}

export default Note;
